import React from "react";

function FilterButton(props) {
    return(
        <button className="btn toggle-btn" aria-pressed={props.isPressed} onClick={() => props.setFilter(props.name)} type="button">
          <span>{props.name}</span>
        </button> 
    )
}

export default FilterButton;
